import React from "react";
import s from 'Graphics.module.css'

const Graphics = (props) => {

    if(!props.change){
    return (
            <div className={s.container_graphics}>
                <div>

                </div>
            </div>
    )}
    return (
        <div>
            График Pre-IPO
        </div>
    )
}

export default Graphics;
